const Homestays = () => {
  const [location, setLocation] = useState('');
  const [homestays, setHomestays] = useState([]);
  const navigate = useNavigate();

  const searchLocation = () => {
    const trimmedLocation = location.trim();
    if (data[trimmedLocation]) {
      setHomestays(data[trimmedLocation].homestays);
    } else {
      setHomestays([]);
    }
  };

  return (
    <div>
      <header>
        <h1>Available Homestays</h1>
      </header>

      <div className="container">
        <div className="section">
          <h2>Search for Homestays</h2>
          <input
            type="text"
            placeholder="Enter a location..."
            style={{ width: '80%', padding: '10px' }}
            value={location}
            onChange={(e) => setLocation(e.target.value)}
          />
          <button style={{ padding: '10px' }} onClick={searchLocation}>
            Search
          </button>
        </div>

        <div className="section">
          <h2>Available Homestays</h2>
          <div className="homestay-list">
            {homestays.length > 0 ? (
              homestays.map((homestay, index) => (
                <div key={index} className="homestay">
                  <img src={homestay.img} alt={homestay.name} />
                  <h3>{homestay.name}</h3>
                  <p>Price: {homestay.price}</p>
                  <a
                    href={`/booking?id=${index}&name=${encodeURIComponent(homestay.name)}`}
                    className="book-now"
                  >
                    Book Now
                  </a>
                </div>
              ))
            ) : (
              <p>No homestays found for this location.</p>
            )}
          </div>
        </div>
      </div>

      <footer>
        <p>&copy; 2024 Homestay Platform</p>
      </footer>

      <div className="btn-container">
        <button onClick={() => navigate('/tourist')}>Back to Dashboard</button>
      </div>
    </div>
  );
};

export default Homestays;
